import React from 'react';

export const View_list = ({ Todo_data }) => {
  return(
    <div>
      <h4>Todoリスト</h4>
      <ul>
        {
          Todo_data.map((todo, i) => {
            return (
              <li key={i}>{todo}</li>
            )
          })
        }
      </ul>

    </div>
  )
}
